column8:
●６ヶ月位の赤ちゃんから。<br>
●オリゴ糖入り。<br>
●お米でできています。<br>
●化学調味料不使用。<br>
<br>
【標準栄養成分】<br>
★１００ｇ当たり<br>
エネルギー 389kcal、 たんぱく質 4.0g、 脂質 0.1g、 炭水化物 93.0g、 ナトリウム 327mg、 食塩相当量 0.83g フラクトオリゴ糖 400mg <br><br>
★個装１袋２枚（約６ｇ）当たり<br>
エネルギー 23.3kcal、 たんぱく質 0.2g、 脂質 0.01g、 炭水化物 5.6g、 ナトリウム 19.6mg、 食塩相当量 0.05g、 フラクトオリゴ糖 24mg <br>
<br>【ご注意】<br>
●赤ちゃんに与えるときは、赤ちゃんの喉に詰まらせないように注意してください。<br>
●ひとりで食べられない場合は少しずつ割って食べさせてあげてください。<br>
●赤ちゃんが喉に詰まらせないように、横になっている時やおんぶの時にはあげるのを避けてください。<br>
●喉に詰まりそうな時には湯ざましなどと一緒に食べさせてあげてください。<br>
●本品製造工場は、小麦・乳・玉子・落花生を含む製品を生産しております。<br>
<br>
<hr>
【名称】
米菓<br>
<br>
【原材料名】
米（国産）、砂糖、食塩、フラクトオリゴ糖、加工でんぷん<br>
<br>
【内容量】
(2枚×8袋) × 12袋<br>
<br>

【賞味期限】パッケージに記載<br><br>
【保存方法】
直射日光、高温多湿をお避けください<br>
<br>
【販売元】<br>
株式会社栗山米菓K4<br>
新潟市北区新埼2661番地<br>
お客様相談室　TEL:0254-24-0927<hr>区分：食品<hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
